import React from 'react';
import burguerLogo from '../../assets/images/burguer-logo.png';
import classes from './Logo.module.css';

const Logo = () => {
    return (
        <div className={classes.Logo} style={{}}>
            <img src={burguerLogo} alt='burguer-logo' />
        </div>
    );
};

export default Logo;
